INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "ぺこりーぬ", "2024/02/29 11:59:59", 121001, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 41, 5, 0, 164, 0, 450, 121001, "2024/02/22 12:00:00", 121001, 1, 1, 121001, "ペコリーヌ（オーバーロード）", 3, 0, 0, 0, 2.25, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "きゃる", "2024/02/29 11:59:59", 121101, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 42, 7, 0, 588, 0, 450, 121101, "2024/02/22 12:00:00", 121101, 1, 2, 121101, "キャル（オーバーロード）", 3, 0, 0, 0, 2.07, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "らびりすた", "2030/12/31 15:00:00", 121201, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 40, 4, 0, 260, 0, 450, 121201, "2023/11/16 15:00:00", 121201, 6, 1, 121201, "ラビリスタ（オーバーロード）", 1, 0, 0, 0, 1.55, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "くるみ", "2030/12/31 15:00:00", 121301, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 3, 3, 0, 731, 0, 450, 121301, "2022/03/03 19:00:00", 121301, 3, 1, 121301, "クルミ（ステージ）", 3, 0, 0, 0, 1.9, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "みさき", "2030/12/31 15:00:00", 121401, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 7, 7, 0, 742, 0, 450, 121401, "2022/03/15 15:00:00", 121401, 15, 2, 121401, "ミサキ（ステージ）", 3, 0, 0, 0, 2.27, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "あゆみ", "2024/04/15 14:59:59", 121501, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 6, 0, 590, 0, 450, 121501, "2024/04/12 12:00:00", 121501, 12, 1, 121501, "アユミ（怪盗）", 3, 0, 0, 0, 2.0, 1);
