INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "りり", "2024/07/26 11:59:59", 131601, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 4, 4, 0, 399, 0, 450, 131601, "2024/07/15 15:00:00", 131601, 0, 1, 131601, "リリ（サマー）", 3, 0, 0, 0, 1.92, 1);
