INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "ほまれ", "2030/12/31 15:00:00", 131801, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 21, 7, 0, 709, 0, 450, 131801, "2024/08/15 15:00:00", 131801, 0, 2, 131801, "ホマレ（サマー）", 3, 0, 0, 0, 2.09, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "じーた", "2030/12/31 15:00:00", 170101, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 34, 34, 0, 245, 0, 450, 105701, "2015/04/01 15:00:00", 170101, 4, 1, 170101, "ジータ", 3, 0, 0, 0, 1.965, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "ひより", "2024/07/03 18:59:59", 180101, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 0, 0, 0, 199, 0, 450, 180101, "2024/06/30 12:00:00", 180101, 7, 1, 180101, "ヒヨリ（プリンセス）", 3, 0, 0, 0, 1.62, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "ゆい", "2024/07/03 18:59:59", 180201, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 0, 0, 0, 767, 0, 450, 180201, "2024/06/30 12:00:00", 180201, 1, 2, 180201, "ユイ（プリンセス）", 3, 0, 0, 0, 1.92, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "れい", "2024/07/03 18:59:59", 180301, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 0, 0, 0, 377, 0, 450, 180301, "2024/06/30 12:00:00", 180301, 7, 1, 180301, "レイ（プリンセス）", 3, 0, 0, 0, 1.965, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "ぺこりーぬ", "2024/07/03 18:59:59", 180401, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 0, 0, 0, 155, 0, 450, 180401, "2024/06/30 12:00:00", 180401, 1, 1, 180401, "ペコリーヌ（プリンセス）", 3, 0, 0, 0, 1.965, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "こっころ", "2024/07/03 18:59:59", 180501, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 0, 0, 0, 555, 0, 450, 180501, "2024/06/30 12:00:00", 180501, 1, 1, 180501, "コッコロ（プリンセス）", 3, 0, 0, 0, 2.14, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "きゃる", "2024/07/03 18:59:59", 180601, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 0, 0, 0, 747, 0, 450, 180601, "2024/06/30 12:00:00", 180601, 1, 2, 180601, "キャル（プリンセス）", 3, 0, 0, 0, 1.92, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "はつねしおり", "2024/07/03 18:59:59", 180701, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 0, 0, 0, 732, 0, 450, 180701, "2024/06/30 12:00:00", 180701, 1, 1, 180701, "ハツネ＆シオリ", 3, 0, 0, 0, 1.75, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "みそぎみみきょうか", "2024/07/03 18:59:59", 180801, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 0, 0, 0, 465, 0, 450, 180801, "2024/06/30 12:00:00", 180801, 1, 1, 180801, "ミソギ＆ミミ＆キョウカ", 3, 0, 0, 0, 1.5, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "あきのされん", "2024/07/03 18:59:59", 180901, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 0, 0, 0, 421, 0, 450, 180901, "2024/06/30 12:00:00", 180901, 1, 1, 180901, "アキノ＆サレン", 3, 0, 0, 0, 2.09, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "あんぐれあ", "2024/07/03 18:59:59", 181001, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 0, 0, 0, 577, 0, 450, 181001, "2024/06/30 12:00:00", 181001, 1, 2, 181001, "アン＆グレア", 3, 0, 0, 0, 2.09, 1);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, "しずるりの", "2024/07/03 18:59:59", 181101, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 0, 0, 0, 551, 0, 450, 181101, "2024/06/30 12:00:00", 181101, 1, 1, 181101, "シズル＆リノ", 3, 0, 0, 0, 1.92, 1);
